class GoogleInteractor:

    def __init__(self, provider, presenter):
        self.provider = provider
        self.presenter = presenter

    def get_google_user_profile_by_access_token(self, access_token):
        user_profile = self.provider.get_user_profile(
            access_token=access_token)
        presenter_user_profile = self.presenter.get_user_profile(user_profile)
        return presenter_user_profile
